import React, { useState } from 'react'
import { CarouselProvider, Slider, Slide, ButtonBack, ButtonNext, Dot } from 'pure-react-carousel';
import useStyles from './CarouselElement'
import 'pure-react-carousel/dist/react-carousel.es.css'
import FiberManualRecordOutlinedIcon from '@material-ui/icons/FiberManualRecordOutlined';
import { Box ,Grid, Typography } from '@material-ui/core';
import Card from './../Card'



const Carousels = () => {
    const classes = useStyles()

    return (

        <Box className={classes.box}>
         <Grid container className={classes.firstgrid} direction='column' alignItems='center'>
            <Grid item xs={10}>
                <Typography className={classes.h2} variant='h3'>
                    TESTIMONIAL
                </Typography>
            </Grid>
            </Grid>
         <Grid container alignContent='center' justify='center' >




         <Grid item xs={0} md={10} >
        <CarouselProvider 
        infinite={true}
        visibleSlides={3}
        isPlaying={true}
        interval={5000}
        naturalSlideWidth={100}
        naturalSlideHeight={100}
        totalSlides={5}

      >

           <Slider>

          <Slide index={0}>
             <Card/>
          </Slide>
          <Slide index={1}> <Card/> </Slide>
          <Slide index={2}> <Card/> </Slide>
          <Slide index={3}> <Card/></Slide>
          <Slide index={4}> <Card/> </Slide>
        </Slider>
     <Dot>..</Dot>
      </CarouselProvider>
      </Grid>
     </Grid>

              </Box>
    )
}

export default Carousels
